import React from 'react';
import Pycharm from '../images/ide/img_pycharm.jpg';
import Visual from '../images/ide/img_visualstudio.png';
import Intellij from '../images/ide/img_intellij.png'
import Eclipse from '../images/ide/img_eclipse.png';

export const IdeList = [
    {   
        id:"1",
        name:"pycharm",
        source:Pycharm,
        url:"www.hackerrank.com",
    },
    {   
        id:"2",
        name:"Visual Studio",
        source:Visual,
        url:"www.hackerearth.com",
    },
    {   
        id:"3",
        name:"Intellij",
        source:Intellij,
        url:"www.codechef.com",
    },
    {   
        id:"4",
        name:"Eclipse",
        source:Eclipse,
        url:"www.codechef.com",
    },
]
